import React from "react";

class Members extends React.Component{

    render() {
        return (
        <div>
            <main>
                {/* Put everything into a new <div></div> attribute*/}
                <section className="PhD-container">
                <h3>Visiting Researchers</h3>
                    <div className= "studentpic">
                            {/* Add a forwardslash to the end of the original html attribute */}
                             <img class="student_imgs" src="./public/MemberPhoto/Members-jinsong Su.jpeg" alt="Prof. Jinsong Su's Portrait" />
                    </div>

                </section>
            </main>


        </div>
        );
    }
}

export default Members;
